    "After the subsection's due date has passed, learners can no longer access its content. The subsection remains included in grade calculations.": "\ud558\uc704 \uc139\uc158\uc758 \ub9cc\uae30\uc77c\uc774 \uc9c0\ub098\uba74 \ud559\uc2b5\uc790\ub294 \ub354 \uc774\uc0c1 \ub0b4\uc6a9\uc5d0 \uc811\uadfc\ud560 \uc218 \uc5c6\uc2b5\ub2c8\ub2e4\u002e \ud558\uc704 \uc139\uc158\uc740 \ub4f1\uae09 \uacc4\uc0b0\uc5d0 \ud3ec\ud568\ub429\ub2c8\ub2e4\u002e",
    "Hide entire subsection": "\uc804\uccb4 \ud558\uc704 \uc138\uc158\uc744 \uc228\uae41\ub2c8\ub2e4\u002e",
