    "When learners submit an answer to an assessment, they immediately see whether the answer is correct or incorrect, and the score received.": "\ud559\uc2b5\uc790\uac00 \ud3c9\uac00\uc5d0 \ub2f5\uc744 \uc81c\ucd9c\ud558\uba74 \uc989\uc2dc \ub2f5\uc774 \uc815\ud655\ud558\uac70\ub098 \ubd80\uc815\ud655\ud55c\uc9c0\u002c \uc810\uc218\ub97c \ubc1b\uc558\ub294\uc9c0 \ud655\uc778\ud569\ub2c8\ub2e4\u002e",
    "Never show assessment results": "\ud3c9\uac00 \uacb0\uacfc\ub97c \ud45c\uc2dc\ud558\uc9c0 \ub9c8\uc2ed\uc2dc\uc624\u002e",
    "Learners never see whether their answers to assessments are correct or incorrect, nor the score received.": "\ud559\uc2b5\uc790\ub294 \ud3c9\uac00\uc5d0 \ub300\ud55c \ub2f5\ubcc0\uc774 \uc815\ud655\ud558\uac70\ub098 \ubd80\uc815\ud655\ud55c\uc9c0 \ub610\ub294 \ubc1b\uc740 \uc810\uc218\uc778\uc9c0 \uc5ec\ubd80\ub97c \uc54c\uc9c0 \ubabb\ud569\ub2c8\ub2e4\u002e",
    "Show assessment results when subsection is past due": "\ud558\uc704 \uc139\uc158\uc774 \ub9cc\uae30\uac00 \uc9c0\ub0ac\uc744 \ub54c \ud3c9\uac00 \uacb0\uacfc\ub97c \ud45c\uc2dc\ud569\ub2c8\ub2e4\u002e",
    "Learners do not see whether their answers to assessments were correct or incorrect, nor the score received, until after the due date for the subsection has passed. If the subsection does not have a due date, learners always see their scores when they submit answers to assessments.": "\ud559\uc2b5\uc790\ub294 \ud3c9\uac00\uc5d0 \ub300\ud55c \ub2f5\ubcc0\uc774 \uc815\ud655\ud558\uac70\ub098 \ubd80\uc815\ud655\ud55c\uc9c0 \ub610\ub294 \ubc1b\uc740 \uc810\uc218\uac00 \ud558\uc704 \uc139\uc158\uc758 \ub9cc\uae30\uc77c\uc774 \uc9c0\ub098\uac08 \ub54c\uae4c\uc9c0 \ubcf4\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4\u002e \ud558\uc704 \uc139\uc158\uc5d0 \ub9cc\uae30\uc77c\uc774 \uc5c6\ub294 \uacbd\uc6b0 \ud559\uc2b5\uc790\ub294 \ud3c9\uac00\uc5d0 \ub300\ud55c \ub2f5\ubcc0\uc744 \uc81c\ucd9c\ud560 \ub54c \ud56d\uc0c1 \uc810\uc218\ub97c \ubcfc \uc218 \uc788\uc2b5\ub2c8\ub2e4\u002e",
    "Learners do not see whether their answers to assessments were correct or incorrect, nor the score received, until after the due date for the subsection has passed.": "\ud559\uc2b5\uc790\ub294 \ud3c9\uac00\uc5d0 \ub300\ud55c \ub2f5\ubcc0\uc774 \uc815\ud655\ud558\uac70\ub098 \ubd80\uc815\ud655\ud55c\uc9c0 \ub610\ub294 \ubc1b\uc740 \uc810\uc218\uac00 \ud558\uc704 \uc139\uc158\uc758 \ub9cc\uae30\uc77c\uc774 \uc9c0\ub098\uac08 \ub54c\uae4c\uc9c0 \ubcf4\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4\u002e",
    "If the subsection does not have a due date, learners always see their scores when they submit answers to assessments.": "\ud558\uc704 \uc139\uc158\uc5d0 \ub9cc\uae30\uc77c\uc774 \uc5c6\ub294 \uacbd\uc6b0 \ud559\uc2b5\uc790\ub294 \ud3c9\uac00\uc5d0 \ub300\ud55c \ub2f5\ubcc0\uc744 \uc81c\ucd9c\ud560 \ub54c \ud56d\uc0c1 \uc810\uc218\ub97c \ubcfc \uc218 \uc788\uc2b5\ub2c8\ub2e4\u002e",
